import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav
        className="navbar navbar-expand-sm"
        style = {{backgroundColor: "blue"}}
      >
        <ul class="navbar-nav">
          <li className="nav-item">MERN LOGIN SYSTEM</li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
